INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4001',20,8,'Use HTML5, CSS3, Flexbox, Grid & SASS to build website content and add stunning styling and decoration. Use Javascript, jQuery & jQuery User Interface to create Interactive Websites and Games.','OPEN','The Complete Web Development Course -  Build 15 Projects');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4002',20,8,'Students will be able to learn all the essential functions of PHP & MySQL and their proper usage. Students will be able to make any kind of modern multi vendors e-commerce store in php&mysqli with the assistance of Bootstrap 3.','OPEN','Modern E-Commerce Store In php & mysqli With Bootstrap');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4003',20,8,'To learn every skill needed as a professional web developer/designer. To create real life projects for your portfolio. To become a professional web developer.','OPEN','Become a Professional Web Developer - Version 3.0');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4004',20,6,'Learn how to build both "fast-twitch" and "minimally invasive" income streams manage clients more efficiently and make more money per project merge.','OPEN','Code & Grow Rich:  Earn More As An Entrepreneur Or Developer');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4005',5,6,'Learn the fundamentals of coding! Create beautiful interactive websites from scratch using the framework of your choice! Become an expert using HTML, CSS, Wordpress, Bootstrap, PHP, AJAX, jQuery, and So Much More!','OPEN','The Complete Web Developer Masterclass: Beginner To Advanced');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4006',15,6,'Learn to create websites using a wysiwyg HTML editor. Learn Basic HTML & CSS. Learn how to develop using PHP and MySQL. Advanced web development languages including JavaScript, jQuery and XML. Learn essentials for AngularJS.','OPEN','Become a Kick-Ass Web Developer: From Newbie to Pro');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4007',15,6,'Learn the Python Programming Language. Learn the Django & Twitter Bootstrap frameworks. Learn how to use APIs. Learn how to accept payments via Stripe. Learn Basic HTML & CSS.','OPEN','Coding for Entrepreneurs: Learn Python, Django, and More.');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4008',10,6,'To learn HTML, HTML 5, CSS, CSS3, C++, C#, jQuery, Game Salad, Stencyl. To learn great development techniques. Learn how to make apps in Xcode. Learn how to make games in Construct 2. Learn adobe illustrator.','OPEN','Back to School Web Development and Programming Bundle');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4009',10,6,'Build sites based on latest and new tips trick with CSS. Complete understanding of the particular topic i will cover on this course. Able to use CSS libraries and plugins fluently. Able to use request a new videos on particular topic in CSS.','OPEN','CSSCasts; CSS libraries Plugins Tips & Tricks for Developers');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4010',10,6,'The ins and outs of HTML5, CSS3, and Modern JavaScript for 2021. Make REAL web applications using cutting-edge technologies. Create responsive, accessible, and beautiful layouts. Recognize and prevent common security exploits like SQL-Injection & XSS.','OPEN','The Web Developer Bootcamp');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4011',10,6,'After Completing this Course , you will have pretty good knowledge about HTML , CSS , Javascript , Jquery , Ajax, Bootstrap, PHP, MYSQL , Wordpress. You will Learn How to Create Multiuser Server Based Photogallery Site.','OPEN','The Most Comprehensive Web Development Course');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4012',5,4,'Implement advanced JavaScript components, such as persistent drag and drop functionality and live page update via ActionCable into a Rails application. Deploying a Rails application along with the ActionCable web socket feature to Heroku.','OPEN','Dissecting Ruby on Rails 5 - Become a Professional Developer');
INSERT INTO capsdata.course(course_code,course_capacity,course_credits,course_description,course_status,course_title) VALUES ('SA4013',5,4,'Learn core concepts of both the front end and backend programming course. Get familiar with the latest web developer technologies and ecosystems. Learn all about sql and nosql databses. Learn complete web development process.','OPEN','The Full Stack Web Development');
